import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';

// import SimpleInput from '../../items/simpleInput/simpleInput';
import FormStar from '../../items/stars/starsForm';

import './movieForm.css';
import { setMediaAction } from '../../store/actions/mediaAction';
import { useSearchParams } from 'react-router-dom';
// import { Link } from 'react-router-dom';

const boy =
  'https://m.media-amazon.com/images/M/MV5BYTY2ZjYyNGUtZGVkZS00MDNhLWIwMjMtZDk4MmQ5ZWI0NTY4XkEyXkFqcGdeQXVyMTY3MDE5MDY1._V1_QL75_UY281_CR18,0,190,281_.jpg';
  const star = 5;

const MovieForm = (props) => {
  const [searchParams] = useSearchParams();
  const movieId = p

  const dispatch = useDispatch();
  const dataRaw = useSelector((state) => state.mediaStore.media);

  const [data, setData] = useState({});

  const updateMedia = async () => {
    if (dataRaw._id) {
      setData(dataRaw);
    }
    if (dataRaw.length) {
      const [dataOne] = await dataRaw.filter((e) => e._id === movieId);
      setData(dataOne);
    }
    if (!data._id && !dataRaw._id && !dataRaw.length) {
      const dataRefresh = await setMediaAction({ _id: movieId }, 'search')(dispatch);
      setData(dataRefresh);
    }
  };

  useEffect(() => {
    if (!data._id) {
      updateMedia();
      console.log(1, data);
    }
  });




  const [isName, setName] = useState('11');
  const [isDescription, setDescription] = useState('11');
  const [isGenre, setGenre] = useState('11');
  const [isYear, setYear] = useState('2000');

  const handleSubmit = (event) => {
    event.preventDefault();
    const formData = Object.fromEntries(new FormData(event.target).entries());
    // setUserAction(formData)(dispatch);
    console.log(formData);
  };
  const handName = (event) => {
    setName(event.target.value);
  };
  const handDescription = (event) => {
    setDescription(event.target.value);
  };
  const handGenre = (event) => {
    setGenre(event.target.value);
  };
  const handYear = (event) => {
    setYear(event.target.value);
  };

  return (
    <form onSubmit={handleSubmit} className="movieForm">
      <img className="image" src={boy} alt="" />
      <div className="infoGrid">
        <input
          className="name"
          onChange={handName}
          type={'text'}
          name={'name'}
          placeholder={'name'}
          value={isName}
        />

        <div className="starsBox">
          <FormStar star={star} />
        </div>

        <div className="infoBox">
          <div>
            <p className="infoName">genre</p>
            <input
              className="infoData"
              onChange={handGenre}
              type={'text'}
              name={'Genre'}
              placeholder={'Genre'}
              value={isGenre}
            />
          </div>
          <div>
            <p className="infoName">ageRating</p>
            <p className="infoData">+props.data.ageRating</p>
          </div>
          <div>
            <p className="infoName">rating</p>
            <p className="infoData">Math.roundprops.data.rating</p>
          </div>
          <div>
            <p className="infoName">year</p>
            <input
              className="infoData"
              onChange={handYear}
              type={'text'}
              name={'Year'}
              min={1900}
              max={new Date().getFullYear()}
              placeholder={'Year'}
              value={isYear}
            />
          </div>
        </div>

        <div className="description">
          <h2 className="infoName">Description:</h2>
          <div>
            <input
              className="infoData"
              onChange={handDescription}
              type={'text'}
              name={'description'}
              placeholder={'description'}
              value={isDescription}
            />
          </div>
        </div>
        <button className="sendButton" type="submit">
          Create and save
        </button>
      </div>
    </form>
  );
};

export default MovieForm;
